    def frase(self,longitud):
        if longitud > 4:
            longitud = 4
        if longitud < 1:
            longitud = 1
        
        opciones2 = deepcopy(self.opciones)
            
        string = ""
        
        for i in range(0, longitud):
            num = random.randrange(0,len(opciones2))
            lista = opciones2[num]
            exec("self.palabra.append (" + lista + '[ randrange(0,len(' + lista + ') )]) ')
            string += self.palabra[i] + " "
            opciones2.pop(num)
            
        string += "letshome"
            
        self.palabra = []
        return string

